import React from 'react';
import logo from './logo.svg';
import Body from './Body';
import Sidebar from './Sidebar';

function App() {
  return (
    <div className="App">
      <link href="https://fonts.googleapis.com/css?family=Lato&display=swap" rel="stylesheet"></link>
      <Sidebar/>
      <Body/>
    </div>
  );
}

export default App;
